		getItem: function (sKey) {
			if (!sKey) { return null; }
			return decodeURIComponent(document.cookie.replace(new RegExp("(?:(?:^|.*;)\\s*" + encodeURIComponent(sKey).replace(/[\-\.\+\*]/g, "\\$&") + "\\s*\\=\\s*([^;]*).*$)|^.*$"), "$1")) || null;
		}
	};

	if (docCookies.getItem('postlead90') !== null) {
		var customerInfo = JSON.parse(docCookies.getItem('postlead90'));
		var personaDoesNotExist = true;

		(function getPersona(){
			for (var key in customerInfo.fields) {
				if (key.indexOf('UserPersona') > -1) {
					personaDoesNotExist = false;
				}
			}
		})();
		return personaDoesNotExist;
	}
})();

